import axios from 'axios';
import { useState } from 'react';

const GetApi = () => {
    const[newData,setNewData] = useState([]);
    axios.get('http://localhost:3001/Profiles')
    .then(resp => {
        setNewData({
            newData:resp.data,
        })
        // newData.map((element) => {
        //     console.log(`${element.id},${element.name},${element.place},${element.contact}`)
        // });
    })  
    .catch(error => {
        console.log(error);
    });
    return(
        <>
        <div>
        {newData.map((e) => {
                      return(
                        <div>
                          <p>{e.id}</p>
                          <p>{e.name}</p>
                          <p>{e.place}</p>
                          <p>{e.contact}</p>
                        </div>
                      )
              })}
        </div>
        </>
    )
}

export default GetApi;
